import React, { useState } from "react";

function App() {
  const [value, setValue] = useState("");
  return (
    <div className="App">
      <h1>{value}</h1>
      <input
        type="text"
        value={value}
        onChange={(event) => setValue(event.target.value)}
      ></input>
    </div>
  );
}

export default App;
